      id: 0,
      name: "In Progress",
      isActive: true
    },
    {
      id: 1,
      name: "History Order",
      isActive: false
    }
  ]
  const handleItemtap = (index) => {
    console.log(index);
  }
  return (
    <div className="order_box">
      {
        titles.map((item, index) => {
          <div className={item.isActive ? style.active : ''} onClick={() => handleItemtap(index)}>
            {item.name}
          </div>
        })
      }
    </div >
  )
}
